import * as io from 'socket.io-client';
import * as dotenv from 'dotenv';
dotenv.config();

class SocketMain {
  constructor(socket) {
    this.socket = socket;
  }

  onTest() {
    console.log(this.socket);
    return 0;
  }
}

export default function Socket() {
  const socket = io("http://localhost:3000", {
    transports: ["websocket"],
  });

  return SocketMain(socket);
}
